#include <stdlib.h>
#include <stdbool.h>

bool isPrime(int n) {
    if (n <= 1) return false;
    for (int i = 2; i * i <= n; i++) {
        if (n % i == 0) return false;
    }
    return true;
}

int** findPrimePairs(int n, int* returnSize, int** returnColumnSizes) {
    *returnSize = 0;
    int capacity = 10; // Initial capacity for result array
    int** result = (int**)malloc(capacity * sizeof(int*));
    *returnColumnSizes = (int*)malloc(capacity * sizeof(int));

    for (int x = 2; x <= n / 2; x++) {
        if (isPrime(x) && isPrime(n - x)) {
            if (*returnSize >= capacity) {
                capacity *= 2; // Increase capacity
                result = (int**)realloc(result, capacity * sizeof(int*));
                *returnColumnSizes = (int*)realloc(*returnColumnSizes, capacity * sizeof(int));
            }

            result[*returnSize] = (int*)malloc(2 * sizeof(int));
            result[*returnSize][0] = x;
            result[*returnSize][1] = n - x;
            (*returnColumnSizes)[*returnSize] = 2;
            (*returnSize)++;
        }
    }

    if (*returnSize == 0) {
        free(result);
        result = NULL;
        free(*returnColumnSizes);
        *returnColumnSizes = NULL;
    } else {
        // Adjust the size of allocated memory to the actual number of prime pairs found
        result = (int**)realloc(result, *returnSize * sizeof(int*));
        *returnColumnSizes = (int*)realloc(*returnColumnSizes, *returnSize * sizeof(int));
    }

    return result;
}
